const keydown_handler = function (evt) {
	if (evt.key === "Enter" || evt.key === "Tab") {
		evt.preventDefault();
		this.blur();
		return;
	}

	if (evt.key === "Escape") {
		this.value = "";
		this.blur();
		return;
	}

	if (!(/^(-?\d*\.?\d*|Backspace|Delete|Arrow\w+)$/).test(evt.key)) {
		evt.preventDefault();
		return false;
	}
};

